import React from "react";
import "./style.css";

function AdTech() {
  return (
    <div>
        <div class="col-sm-12 col-md-12 col-lg-12 col-xl-12 justify-content-sm-center">
          <div class="wrapper position-relative mb-4">
            <a href="https://www.linkedin.com/in/eurbaez/">
              <img className="img-fluid" id="geek-image"
                src="https://icon-library.net/images/linkedin-black-icon/linkedin-black-icon-26.jpg"
                alt="Ad-Tech Experience" />
              <div className="box-1 position-absolute">Ad-Tech Experience</div>
            </a>
          </div>
        </div>
    </div>
  );
}

export default AdTech;
